import axios from "axios";
import React, {Component} from "react";
import {Button, Container} from "react-bootstrap";
// import './Profile_Details.css';
import urlAddress from "../../ip.json";

const url = 'http://'+urlAddress.ip+':8080/api/';
console.log(urlAddress.ip);

class CreateDeleteButton extends Component
{

    deleteAccount(){
        alert("Are sure you want to delete the account..this will delete all the data");
        axios.delete(url + `users/3`)
            .then(response =>{
                console.log(response)
            })
            .catch(error =>{
                console.log(error);
                alert("Account successfully deleted");
            
            })
    }
    
        render(){
               return (   
                 <Container >
                    <Button
                        id="btnDelete" type="Button" value="Delete"
                        variant="danger" 
                        style={{ marginRight: '0%' }}
                          className="Button"
                        href="/login">
                          
                        Delete account
                    </Button>
                 </Container>
                 
               );
               
           }
}

         
      export default CreateDeleteButton;
